import React, {useContext} from 'react';
import {Button, Card, DatePicker, Form, Input} from "antd";
import Title from "antd/es/typography/Title";
import {observer} from "mobx-react-lite";
import {Context} from "../../index";


const Profile = () => {
    const {user} = useContext(Context)
    return (
            <div style={{margin:30, minWidth:300}}>
                <Card  bordered={false} style={{  padding:30 }}>
                    <Title level={2}>Контактыне даннные</Title>
                <Form.Item

                    name="email"
                    rules={[
                        {

                            message: 'почта не корректна',
                            required: true,
                            type: 'email',
                        },
                    ]}
                >
                    <Input defaultValue={user.user} disabled size={"large"} placeholder="Почта"/>
                </Form.Item>

                <Form.Item
                    name="name"
                    rules={[
                        {

                            message: 'не корректно',
                            required: false,
                        },
                    ]}
                >
                    <Input size={"large"} placeholder="Имя"/>
                </Form.Item>
                <Form.Item
                    name="surname"
                    rules={[
                        {
                            message: 'введите фамилию',
                            required: false,
                        },
                    ]}
                >
                    <Input size={"large"} placeholder="Фамилия"/>
                </Form.Item>
                <Form.Item
                    name="birthday"
                    rules={[
                        {

                            message: 'введите дату',
                            type: 'date',
                            required: false,
                        },
                    ]}
                >
                    <DatePicker size={"large"}  placeholder="Дата рождения"/>
                </Form.Item>
                <Form.Item style={{textAlign: 'right'}}>
                    <Button type="primary" htmlType="submit" style={{width: 200, height: 40, fontSize: 16,  backgroundColor:'#722ed1'}}
                        // onClick={
                        // }
                    >
                        Сохранить изменения
                    </Button>
                </Form.Item>
                </Card>
            </div>

    );
};

export default observer(Profile);
